def project = testRunner.testCase.testSuite.project
def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )
def aboutMessage = "You must provide your login"
def oTestSuite = testRunner.testCase.testSuite;
// Get the count of test cases in a testSuite
def iTotalTestCases = oTestSuite.getTestCases().size();	

try {
// New variable, which take the response of the request 
	def Response = groovyUtils.getXmlHolder( "NULL_VALUES#Response" )
	// With the variable, we take values which are in the node
	def message = Response.getNodeValues('//*:faultstring');
	// Create testSuite object

	// With this loop, we take each values which are in the node.
	for (aboutM in message) {
		testRunner.testCase.setPropertyValue("aboutM", "$aboutM" )

		if(aboutMessage != aboutM){
			for(testCaseCounter in (0..iTotalTestCases-1)){  
				 def sTestCaseName = oTestSuite.getTestCaseAt(testCaseCounter).name	
				 if (sTestCaseName == "check_gazelleMonitorWS TestCase"){
				 	oTestSuite.getTestCaseByName(sTestCaseName).setDisabled(false)
				 } else {
				 oTestSuite.getTestCaseByName(sTestCaseName).setDisabled(true)
				 }
				 log.info sTestCaseName
				}
		} else {
			for(testCaseCounter in (0..iTotalTestCases-1)){  
				 def sTestCaseName = oTestSuite.getTestCaseAt(testCaseCounter).name		
				 if (sTestCaseName == "check_gazelleMonitorWS TestCase"){
				 	oTestSuite.getTestCaseByName(sTestCaseName).setDisabled(false)
				 } else {
				 oTestSuite.getTestCaseByName(sTestCaseName).setDisabled(false)
				 }
				 log.info sTestCaseName
				}		
			}

	}

} catch(Exception e){

	for(testCaseCounter in (0..iTotalTestCases-1)){  
		 def sTestCaseName = oTestSuite.getTestCaseAt(testCaseCounter).name	
			 if (sTestCaseName == "check_gazelleMonitorWS TestCase"){
			 	oTestSuite.getTestCaseByName(sTestCaseName).setDisabled(false)
			 } else {
			 oTestSuite.getTestCaseByName(sTestCaseName).setDisabled(true)
			 }


		}

	}

